import '../index.css';

function Card({item}) {
  return (
    <>
    <article className="element"
    key = {item._id} 
    >
    <img src={item.link} alt={item.name} className="element__image"></img>
    <button className="element__delete-button" type="button"></button>
    <div className="element__info">
      <h2 className="element__name">{item.name}</h2>
      <div className="element__likes">
        <button className="element__like-button element__like-button_disabled" type="button"></button>
        <p className="element__like-number">{item.likes.length}</p>
    </div>
    </div>
  </article>
  </>
)}

export default Card;
